INSERT INTO `gp_dashboardquote` (`id`, `quote`, `adddate`, `showon`, `status`, `reserved`) VALUES
(1, 'Do you know you can lose up to 300% more weight with a combined diet and exercise plan than either alone?', '2013-12-18 07:43:58', 1, 1, NULL),
(2, 'Burn calories, fight fat and increase your metabolism – you may not know it, but key for everything lies in eating right. ', '2013-12-18 07:45:23', 1, 1, NULL),
(3, 'Get a what-to-eat plan or hire a nutritionist to complement your workout or weight-watching routine.', '2013-12-18 07:45:41', 1, 1, NULL),
(4, 'An ad hoc exercise routine will only help you lose or gain a few pounds. A regular workout with a specialist will improve your health for the lifetime.', '2013-12-18 07:45:55', 1, 1, NULL),
(5, 'Even 90-year-old women who use walkers have been shown in studies to benefit from light weight training.', '2013-12-18 07:45:55', 2, 1, NULL),
(6, 'Burn calories, fight fat and increase your metabolism – you may not know it, but key for everything lies in eating right.', '2013-12-18 09:42:05', 2, 1, NULL),
(7, 'Get a what-to-eat plan or hire a nutritionist to complement your workout or weight-watching routine.', '2013-12-18 09:42:05', 2, 1, NULL),
(8, 'By cutting down 500 calories from your daily calorie intake, you can lose 1 kg of your weight in approximately 17 days.', '2014-01-25 01:24:46', 2, 1, NULL),
(9, 'You’ll get the most cardiovascular benefit when you exercise at 50% to 85% of your maximum heart rate.', '2014-01-25 01:40:18', 2, 1, NULL),
(10, 'Drink about 600 ml of water two to three hours before exercise and 250 ml more about 25 minutes before you start and about 300 ml of water every 10 to 20 minutes during your exercise.', '2014-01-25 01:40:18', 2, 1, NULL),
(11, ' Working your muscles to the point of tiredness is a good way to strengthen and tone them.', '2014-01-25 01:40:18', 2, 1, NULL),
(12, 'You can’t target specific parts of your body for weight loss. To lose fat and weight from a specific area, you have to do regular physical activity that works your entire body.', '2014-01-25 01:40:18', 2, 1, NULL),
(13, 'Burn more calories with physical activities. Choose foods that are larger in volume but contain low calories.', '2014-01-25 01:40:18', 2, 1, NULL),
(14, 'You burn more calories sleeping than you do watching television.', '2014-01-25 01:40:18', 2, 1, NULL),
(15, ' Bananas are high in sugar, so they should not be eaten if you have blood sugar problems.', '2014-01-25 01:40:18', 2, 1, NULL),
(16, 'Three square meals or five or six small meals—has a huge impact on weight management.', '2014-01-25 01:40:18', 2, 1, NULL),
(17, 'Muscle is 3 times more efficient at Burning calories than fat.', '2014-01-25 01:40:18', 2, 1, NULL),
(18, 'Studies have suggested that walking at a brisk pace for three or more hours a week can reduce your risk for coronary heart disease by 65 percent.', '2014-01-25 01:40:18', 2, 1, NULL),
(19, 'No matter how poor your current level of fitness, you can start an exercise routine and become fitter and healthier. Even 90-year-old women who use walkers have been shown in studies to benefit from light weight training.', '2014-01-25 01:40:18', 2, 1, NULL),
(20, ' It takes about 12 weeks after starting an exercise program to see measurable changes in your body. However, before 12 weeks, you will notice an increase in your strength and endurance.', '2014-01-25 01:40:18', 2, 1, NULL),
(21, ' Fitness consists of four components: your body ability to use oxygen as a source of energy, which translates into cardiovascular fitness; muscular strength and endurance; flexibility; and body composition.', '2014-01-25 01:47:17', 2, 1, NULL),
(22, 'The best time to exercise?  Research shows that your body will adjust to whatever time of day works for you. The most important thing is to pick a time of day you can stick with.', '2014-01-25 01:47:17', 2, 1, NULL),
(23, 'You should warm up every time you exercise and cool down afterward.', '2014-01-25 01:47:17', 2, 1, NULL),
(24, ' Walking - Begin with five to 10 minutes at a time. Add a few minutes to each walk until you get to at least 30 minutes per walk. ', '2014-01-25 01:47:17', 2, 1, NULL),
(25, ' Interval (10 minutes) training lets you boost fitness, burn more calories, and lose weight. ', '2014-01-25 01:47:17', 2, 1, NULL),
(26, 'Squats work several muscle groups quadriceps, hamstrings, and gluteal -- at the same time.', '2014-01-25 01:47:17', 2, 1, NULL),
(27, 'Exercise makes you feel more energized because it releases endorphins into the blood.', '2014-01-25 01:47:17', 2, 1, NULL),
(28, 'Consistency and patience are keys to long term successful weight loss.', '2014-01-25 01:47:17', 2, 1, NULL),
(29, 'Dehydrating a muscle by 3% can cause a 10% loss of strength.', '2014-01-25 01:47:17', 2, 1, NULL),
(30, 'You don’t need a gym membership to strength train.', '2014-01-25 01:47:17', 2, 1, NULL),
(31, 'Healthy levels of testosterone are good for both men and women.', '2014-01-25 01:47:17', 2, 1, NULL),
(32, ' Push-ups strengthen your chest, shoulders, triceps, and core muscles.', '2014-01-25 01:47:17', 2, 1, NULL),
(33, 'You don’t need a gym membership to strength train.', '2014-01-25 01:48:03', 2, 1, NULL),
(34, 'Healthy levels of testosterone are good for both men and women.', '2014-01-25 01:48:03', 2, 1, NULL),
(35, ' Push-ups strengthen your chest, shoulders, triceps, and core muscles.', '2014-01-25 01:48:03', 2, 1, NULL),
(36, 'Healthy levels of testosterone are good for both men and women.', '2014-01-25 01:52:06', 2, 1, NULL),
(37, ' Push-ups strengthen your chest, shoulders, triceps, and core muscles.', '2014-01-25 01:52:06', 2, 1, NULL),
(38, ' Fitness can be achieved through small changes in what you eat and your level of activity. Patience is essential. Don''t try to do too much too soon, and don''t quit before you have a chance to experience the rewards of improved fitness and a healthy diet!', '2014-01-25 01:52:06', 2, 1, NULL),
(39, 'Weight loss is the main reason people exercise at all, but losing weight is certainly not the only benefit of exercising. Strive to feel better and to have more energy. You''ll get more out of your program if you notice the small payoffs that exercise provides in a very short amount of time.', '2014-01-25 01:52:06', 2, 1, NULL),
(40, 'Being skinny does not automatically mean you have a low body fat.', '2014-01-25 01:52:06', 2, 1, NULL),
(41, ' It’s harder to put on 10 pounds of muscle than it is to lose 10 pounds of fat.', '2014-01-25 01:52:06', 2, 1, NULL),
(42, '0 grams of fat on a label doesn’t always mean there’s no fat in the food product.', '2014-01-25 01:52:06', 2, 1, NULL),
(43, 'A warm-up should include 5 to 10 minutes of exercise such as walking, slow jogging, knee lifts. Warming up is important to help prevent injury and maximize benefits from exercise.', '2014-01-25 01:52:06', 2, 1, NULL),
(44, 'Myth - The more you sweat during a workout, the more fat the body is burning. The amount you sweat is indicative of your body''s ability to maintain its normal body temperature. ', '2014-01-25 01:52:06', 2, 1, NULL),
(45, 'A desirable level of fitness can be achieved through as little as 3 workouts per week.', '2014-01-25 01:52:06', 2, 1, NULL),
(46, 'Myth - Older adults are least likely to benefit from physical activity. Physical activity is one of the most important steps older adults can take to maintain physical and mental health and quality of life.', '2014-01-25 01:52:06', 2, 1, NULL),
(47, '  Active people don’t need extra protein or protein supplements to build muscles. A certain amount of protein is needed to help build the muscles, but a nutritious, balanced diet every day will supply all of the protein that the muscles need.', '2014-01-25 01:52:06', 2, 1, NULL),
(48, ' Exercise is the silver bullet for a better quality of life. Not only does regular exercise aid in weight loss, it reduces your risk for several chronic diseases and conditions such as heart disease, high blood pressure (hypertension), stroke, type 2 diabetes and obesity.', '2014-01-25 01:52:06', 2, 1, NULL),
(49, 'Myth - Crunches and sit-ups are the best way to lose belly fat.  A full-body exercise routine builds lean muscle all over. The best plan for this is regular exercise, resistance training, and a healthy, calorie-controlled diet.', '2014-01-25 01:52:06', 2, 1, NULL),
(50, ' Muscle burn calories even when the body is at rest. Exercise helps build muscle mass, and muscle tissue burns more calories than body fat, even when the body at rest. ', '2014-01-25 01:52:06', 2, 1, NULL),
(51, 'Myth - Working out at a gym will provide the best results. Research showed that there are plenty of exercises you can do at home or outdoors using your own body weight and gravity. ', '2014-01-25 01:52:06', 2, 1, NULL),
(52, ' Deep breathing gives health benefits similar to aerobics.', '2014-01-25 01:52:06', 2, 1, NULL);
