INSERT INTO `gp_faq` (`id`, `question`, `answer`, `status`) VALUES
(1, 'Is your website free?', 'Yes and will always be.', 1),
(2, 'I want very specific assistance in my workout schedule. Can you help?', 'Yes. We list fitness professionals for different levels of working-out routine. You can surf our website and contact us directly you?re unable to find the kind of expert you require. We will do whatever best we can to help you.', 1),
(3, 'How is finding a professional through your website better than the looking the old-fashioned way? ', 'GymPik offers a 360-degree holistic approach, including a robust platform and hoard of free suggestions. We collaborate all the kinds of data online to give you fast and effective options.', 1),
(4, 'How do I submit a request?', 'No need to submit a request. Register online and start searching health specialists instantly.', 1),
(5, 'By when can I expect a response?', 'It normally takes 24-48 hours for your responses to start coming.', 1),
(6, 'What if I can?t find what I?m looking for in your categories? ', 'Please contact us at ____________________ (phone/email).', 1),
(7, 'Do I have to be a member to see the profiles of the professionals?', 'Yes. The profiles of health professionals are visible to registered users only.', 1),
(8, 'I chose an expert. Now what?', 'You can hire him/her and begin your workout sessions. You can also track your progress through GymPik.', 1);
